カメのぬいぐるみです。<BR><BR>

親亀・子亀を引っ張るとブルブル動きます。<br>
肌触りも良く、何度もひっぱってついつい遊んでしまう…なんとも可愛いぬいぐるみおもちゃです。
<br><br>
ぬいぐるみの大きさは、親ガメ約13cm・小ガメ約6cm
です。<br>
